#include <iostream>
using namespace std;
#include <cstring>
class Solution {
public:
    bool isMatch(const char *s, const char *p) {
        if(strlen(p)==0){
            if(strlen(s)==0){
                return true;
            }
            else{
                return false;
            }
        }
        if(strlen(s)>300 && p[0]=='*' && p[strlen(p)-1]=='*'){
            return false;  
        }
        bool d[strlen(p)+1][strlen(s)+1];
        memset(d, 0, sizeof(d));
        //bool **d=new bool*[strlen(p)+1];
        //for(int i=0;i<strlen(p)+1;i++){
        //    d[i]=new bool[strlen(s)+1];
        //}
        for(int i=0;i<strlen(p)+1;i++){
            for(int j=0;j<strlen(s)+1;j++){
                d[i][j]=0;
            }
        }
        int flag=1;
        for(int i=1;i<strlen(p)+1;i++){
            if(p[i-1]=='*' and flag==1){
                d[i][0]=1;
            }
            else{
                flag=0;
                d[i][0]=0;
            } 
        }
        for(int j=0;j<strlen(s)+1;j++){
            d[0][j]=0;
        }
        d[0][0]=1;
        for(int i=0;i<strlen(p);i++){
            for(int j=0;j<strlen(s);j++){
                if(p[i]=='*'){
                    for(int t=j;t>=-1;t--){
                        if(d[i][t+1]==1){
                            d[i+1][j+1]=1;
                            break;
                        }
                    }
                    
                }
                else if(p[i]=='?' and d[i][j]){
                    d[i+1][j+1]=1;
                }
                else if(p[i]==s[j] and d[i][j]){
                    d[i+1][j+1]=1;
                }
                else{
                    d[i+1][j+1]=0;
                }
            }
            
            
        }
        for(int i=0;i<strlen(p)+1;i++){
            for(int j=0;j<strlen(s)+1;j++){
                cout<<d[i][j]<<' ';
            }
            cout<<endl;
        }
        return d[strlen(p)][strlen(s)];
        
    }
};
